import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Home from '../components/Home';


function Notes(){
    return(
    <Router>
        <div>
            <ul>
                <li>
                <Link to="/">Home</Link>
                </li>
            </ul>

            <hr />
        <Routes>
            <Route exact path="/" component={Home} />

        </Routes>

        </div>
    </Router>
    );
}export default Notes;
